import * as React from "react"

type Props = {
  saveTodo: (todo: ITodo | any) => void
}

export const AddTodo: React.FC<Props> = ({ saveTodo }) => {
  const [todo, setTodo] = React.useState<ITodo | {}>()

  const handleTodoData = (e: React.FormEvent<HTMLInputElement>) => {
    setTodo({
      ...todo,
      [e.currentTarget.id]: e.currentTarget.value,
    })
  }

  console.log(todo);

  const addNewTodo = (e: React.FormEvent) => {
    e.preventDefault()
    saveTodo(todo)
  }

  return (
    <form onSubmit={addNewTodo} className="Add-todo">
      <input
        type="text"
        id="title"
        placeholder="Title"
        onChange={handleTodoData}
      />
      <input
        type="text"
        id="description"
        placeholder="Description"
        onChange={handleTodoData}
      />
      <input
        type="text"
        id="dueDate"
        placeholder="DueDate"
        onChange={handleTodoData}
      />
      <select id="priority" onChange={() => handleTodoData}>
        <option value="0">LOW</option>
        <option value="1">MEDIUM</option>
        <option value="2">HIGH</option>
      </select>
      <button>
        Add todo
      </button>
    </form>
  )
}
